svg.script:
	

	
	onload = function() {
		
		var escapement = { element: document.getElementById("Escapement_1_"), pivot: { x: 289.661, y: 159.713 } };
		var escapement_lever = { element: document.getElementById("Escapement_Lever_1_"), pivot: { x: 290.767 , y: 55.13  } };
		var gear64 = { element: document.getElementById("Gear_64"), pivot: { x: 138.586, y: 171.916 } };
		var gear12 = { element: document.getElementById("Gear_12"), pivot: { x: 289.951, y: 159.41 } };
		var gear8 = { element: document.getElementById("Gear_8"), pivot: { x: 138.589, y: 171.917 } };
		var gear90 = { element: document.getElementById("Gear_90"), pivot: { x: 295.599, y: 288.951 } };
		var gear16 = { element: document.getElementById("Gear_16"), pivot: { x: 295.603, y: 288.954 } };
		var gear40 = { element: document.getElementById("Gear_40"), pivot: { x: 407.567, y: 288.954 } };
		var gear10 = { element: document.getElementById("Gear_10"), pivot: { x: 407.566, y: 288.957 } };
		var gear48 = { element: document.getElementById("Gear_48"), pivot: { x: 295.599, y: 288.957 } };
	
		var pairs = [
			{ period: 60, gears: [gear12, escapement] },
			{ period: 320, gears: [gear64, gear8] },
			{ period: 3600, gears: [gear90, gear16] },
			{ period: 9000, gears: [gear40, gear10] },
			{ period: 43200, gears: [gear48] }
		];
		
		
		
		var pendulum = {mass: 100, length:1000, theta: (Math.PI/2) - Math.PI*8/180, omega: 0, alpha:0};
		pendulum.J = pendulum.mass * pendulum.length * pendulum.length / 500;
		var lastTime = 0;
		function getPendulumRotation(time) {
			var deltaT = time - lastTime;
			
			if(deltaT > 0.05) deltaT = 0.05;
			if(deltaT < 0) deltaT = 0.05;
			
			
			/* Velocity Verlet */
			/* Calculate current position from last frame's position, velocity, and acceleration */
			pendulum.theta += pendulum.omega * deltaT + ( 0.5 * pendulum.alpha * deltaT * deltaT );

			/* Calculate forces from current position. */
			var T = pendulum.mass * 9.81 * Math.cos(pendulum.theta) * pendulum.length;

			/* Current acceleration */
			var alpha = T / pendulum.J;

			/* Calculate current velocity from last frame's velocity and 
				average of last frame's acceleration with this frame's acceleration. */
			pendulum.omega += 0.5 * (alpha + pendulum.alpha) * deltaT;
    
			/* Update acceleration */
			pendulum.alpha = alpha;

			return pendulum.theta;
		}
	
		function updateGears(pos) {		
		
			for(var i=0;i<pairs.length;i++) {
				var period = pairs[i].period;
				var gears = pairs[i].gears;
			
				var theta = ((pos / period) * 360) % 360;
				
				if(i%2==0) theta = -theta;
			
				for(var g=0;g<gears.length;g++) {
					var gear = gears[g];
				
					var element = gear.element;
					var pivot = gear.pivot;
				
					var transform = "rotate(" + theta + " " + pivot.x + " " + pivot.y + ")";
					element.setAttribute("transform", transform);
				}
			}
			

			//var 2s = (pos % 2) / 2;
			//var min_lev = -11;
			//var max_lev = 9;
			
			elpivot = escapement_lever.pivot;
			elelement = escapement_lever.element;
			
			var rot = getPendulumRotation(pos) * 180 / Math.PI - 90;
			var transform = "rotate(" + rot + " " + elpivot.x + " " + elpivot.y + ")";
			elelement.setAttribute("transform", transform);

		}
	
	
	
		var interval = setInterval(function() {
			var time = new Date();
			var pos = time.getMilliseconds() * 0.001 + time.getSeconds() + time.getMinutes() * 60 + (time.getHours() % 12) * 3600;
			
			updateGears(pos);
		}, 33);
	}
